import React, { useEffect, useState } from "react";
import { useDispatch, useSelector } from "react-redux";
import { Link } from "react-router-dom";
import {
  allblockedUsers,
  blockUser,
  getAllEmplyers,
} from "../../actions/adminActions";

import Switch from '@mui/material/Switch';
import Alert from "@mui/material/Alert";

const BlockedUsers = () => {
  const dispatch = useDispatch();

  const Employees = useSelector((state) => state.blockedUsers);
  const [keyword, setKeyword] = useState("");
  const [alert, setAlert] = useState(false);

  console.log(Employees);

  useEffect(() => {
    dispatch(allblockedUsers());
  }, []);

  const handleSubmit = (e) => {
    e.preventDefault();
    dispatch(allblockedUsers());
  };

  return (
    <div>
      {" "}
      <div className="bottom">
        {alert ? (
          <Alert
            style={{ position: "fixed", top: "30px", right: "50px" }}
            severity="warning"
          >
            Loading !
          </Alert>
        ) : (
          ""
        )}
        {Employees
          ? Employees?.data?.map((dt) => {
              return (
                <div key={dt?._id} className="talent-result">
                  <div className="t-left">
                    <img
                      src={
                        dt?.employeeData?.image
                          ? dt?.employeeData?.image
                          : "https://t3.ftcdn.net/jpg/03/46/83/96/360_F_346839683_6nAPzbhpSkIpb8pmAwufkC7c5eD7wYws.jpg"
                      }
                      alt=""
                    />
                    <div>
                      <p style={{ color: "#3ccf4e" }}>{dt?.name}</p>
                      {/* <h4>{dt?.userTitle.slice(0, 20)}. . .</h4> */}
                      <p>
                        total earend:{" "}
                        <strong>{dt?.employeeData?.totalEarned}</strong>
                      </p>
                    </div>
                  </div>

                  <div className="t-right">
                    {/* <BookmarkBorderIcon
                  onClick={() => {
                    dispatch(saveTalents(dt?.owner?._id));
                    setAlret(true);
                    setTimeout(() => {
                      setAlret(false);
                    }, 1000);
                  }}
                  style={{ color: "#3ccf4e", cursor: "pointer" }}
                /> */}
                    <button>
                      {" "}
                      <Link
                        onClick={(e) => {
                          dispatch(blockUser(dt?._id, keyword, "other"));
                          setAlert(true);
                          setTimeout(() => {
                            setAlert(false);
                          }, 1500);
                        }}
                      >
                        {" "}
                        {dt?.isBlocked ? "unblock" : "block"}
                      </Link>
                    </button>

                    <Switch {...label} defaultChecked color="default" />

                    <button>
                      {" "}
                      <Link to={`/user/publicView/${dt?._id}`}> Profile</Link>
                    </button>
                  </div>
                </div>
              );
            })
          : ""}
      </div>
    </div>
  );
};

export default BlockedUsers;
